import React from 'react';
import Header from '../components/Header';
import { Footer } from '../components/Footer';
import { TextInputField } from '../components/InputTextField';

export const Contact = () => {
  return (
    <div>
      <div className='shadow-lg'>
        <Header />
      </div>
      <div className='mt-9 flex w-[90%] mx-auto justify-center'>
        <div className='w-[100%] md:w-[80%]'>
          <div className='flex justify-between flex-col md:flex-row'>
            <div className='w-[49%]'>
              <TextInputField label='First Name' placeholder='First Name' />
            </div>
            <div className='w-[49%]'>
              <TextInputField label='Last Name' placeholder='Last Name' />
            </div>
          </div>
        </div>
      </div>

      <div>
        <Footer />
      </div>
    </div>
  );
};
